import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchDogs } from "../../store/actions";
import Dog from "../Dog";

export default function Dogs({
  name,
  height,
  weight,
  years,
  image,
  temperament,
}) {
  let dog = useSelector((state) => state.dogs);
  let dispatch = useDispatch();
  useEffect(() => {
    dispatch(fetchDogs());
  }, []);
  return (
    <div>
      {dog.map((item) => {
        return (
          <div>
            <Dog
              name={item.name}
              height={item.height}
              weight={item.weight}
              years={item.years}
              image={item.image}
              temeperament={item.temeperament}
            />
          </div>
        );
      })}
    </div>
  );
}
